import React from 'react'
import axios from 'axios'
const AllProducts = (props) => {
  let allProducts = { props }
  return (
    <div>
      <h2>All products</h2>
      <div>
        {AllProducts.map((product, i) => {
          ;<li key={i}>{product.title}</li>
        })}
      </div>
    </div>
  )
}

export default AllProducts
